import React from "react";
import Style from "./Style";
import Container from "./Container";
import title from "./title2.svg";

const Main = () => {
  return (
    <Container>
      <Style>
        <div className="main">
          <div className="body">
            <h1>Наслаждайся жизнью,</h1>
          {/* <img src={title} alt="" /> */}</div>
        </div>
      </Style>
    </Container>
  );
};

export default Main;
